import { Container } from "@mui/material";
import Driver from "./components/Driver";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
    <Routes>
        {/* <Route path="/notes" element={<Notes />} /> */}
        {/* <Route path="/users" element={<Users />} /> */}
        <Route path="/" element={<Driver />} />
    </Routes>
    <Container 
      maxWidth={false} 
      children={<Driver />}
    />
    </>
  );
}

export default App;
